import Vue from 'vue'
import App from './App.vue'
import vueRouter from './vueRouter'

Vue.config.productionTip = false

Vue.use(vueRouter)

const router =new vueRouter({})

new Vue({
  render: h => h(App),
}).$mount('#app')
